function AudioManager(){
    this.startingBGM = new Audio('/sounds/got_funk.ogg');
    this.battlingBGM = new Audio('/sounds/there_it_is.ogg');
    this.isSounded = false;

    this.punchAudioData = "data:video/ogg;base64,";
    this.failAudioData = "data:video/ogg;base64,";

    this.currentAudio = this.startingBGM;

    this.punch = function(){
	var audio = new Audio(this.punchAudioData);
	audio.play();
    };

    this.fail = function(){
	var audio = new Audio(this.failAudioData);
	audio.play();
    };

    this.play = function(){
	this.currentAudio.play();
	this.isSounded = true;
    };

    this.toBattle = function(){
	this.startingBGM.pause();
	this.battlingBGM.pause();
	this.currentAudio = this.battlingBGM;
	if ( this.isSounded == true ){
	    this.play();
	};
    };

    this.mute = function(){
	this.startingBGM.pause();
	this.battlingBGM.pause();
	this.isSounded = false;
    };
}
